// import './App.css';
import Header from "../src/components/Header";
import Card from './components/Cards';
import image from './components/assets/one.jpg'
function App() {
  return (
    <div className="App">
      <Header />
      <Card />
      <img src={image} 
      style={{ width: '1000px', height: '200px' }}
      />

    </div>
  );
}

export default App;
